import React from 'react';
const Post = (props) => {
    return (
        <div>
            <div className="profile">
                <img src = {ANAKIN_IMAGE}></img>
                <div>
                    <p className="user__name">{props.name}</p>
                    <p className="nick__name">{props.nickname}</p>
                    <p className="date__post">{props.date}</p>
                </div>
            </div>
            <p className="content">{props.content}</p>
        </div>
    );
}
Post.defaultProps = { name: "Anakin skywalker", nickname: "@dart_vader", content: "WTF? Who is Ray? Why she is Skywalker? Luke...?", date: "26 февр." };
export default Post;
